import React, { useState, useEffect } from "react";
import "./App.css";
import NasaCard from './components/NasaCard';
import axios from 'axios';



function App() {

  useEffect(()=>{
    axios
      .get('https://api.nasa.gov/planetary/apod?api_key=fa5O3BQljsEyqfNarlgF5bX4t4TbK6vLbySh9i7H&')
      .then(res => console.log(res))
      .catch(err=> console.log(err));
    }, []);

    const [date, setDate] = useState(res.data.date), 
        [explanation, setExplanation] = useState(res.data.explanation),
        [title, setTitle] = useState(res.data.title),
        [url, setURL] = useState(res.data.url);

  return (
    <div className="App">
      <NasaCard 
        date={date}
        explanation={explanation}
        title={title}
        url={url}
      />
    </div>
  );
}

export default App;
